  \"2014-06-19T02:46:49.076984\",\n\t\"name\": \"organic-handlers-procurement-and-contracting\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Get select results from the 2004 and 2007
  Nationwide Surveys of Organic Manufacturers, Processors, and Distributors. Data
  are available on 9 commodity groups, such as fruit and nuts, and 45 commodities,
  such as berries and citrus. The vast majority of organic commodities pass through
  the hands of at least one middleman, also called a handler, on the way from the
  farmer to the consumer. Certified organic handlers are certified to handle organic
  products in accordance with National Organic Standards. Organic handlers perform
  numerous functions, including packing and shipping, manufacturing and processing,
  and brokering, wholesaling, or distributing.\",\n\t\"license_title\": \"Creative
